import React from "react";
import "../things_we_can_prob_delete/App.css";

function HomePage() {
  return (
    <div className="App">
      <a
        className="App-link"
        href="https://reactjs.org"
        target="_blank"
        rel="noopener noreferrer"
      >
        Learn React
      </a>
    </div>
  );
}

export default HomePage;
